		return(

				<div>

			 	<li class="nav-item navItems">   
                          <a  onClick={()=>onLogoutClick('signin')} class="log"  id="open-modal">Logout</a>
                </li>

                </div>

		)

	}

	else{

		return(

				<div>

				 <li class="nav-item navItems">   
                          <a  onClick={()=>onLogoutClick('signout')} class="log"  id="open-modal">Login</a>
                </li>


                 </div>

                 )




	}
}
